import React from "react";
import IndividualInvoice from "./IndividualInvoice";

const Invoices = (props) => {
    return (
        <div>
            {props.data?.invoices.map((invoice) => {
                <IndividualInvoice 
                key={invoice._id}
                name={invoice.name}
                dueDate={invoice.dueDate}
                billNo={invoice.billNo}
                billDate={invoice.billDate}                   
                grossAmount={invoice.grossAmount}
                netAmount={invoice.netAmount}
                notes={invoice.notes}
                status={invoice.status}
                createdAt={invoice.createdAt}
                updatedAt={invoice.update}
                prodId={invoice.lineItem[0]._id}
                productName={invoice.lineItem[0].productName}
                quantity={invoice.lineItem[0].quantity}
                price={invoice.lineItem[0].price}
                amount={invoice.lineItem[0].amount}
                gstRate={invoice.lineItem[0].gstRate}
                />})

            })}
        </div>
    )
}

export default Invoices;
